import React from 'react'
import { StyleSheet, Text, View,StatusBar,Image } from 'react-native'
// import {Colors} from '../../src/constants';


const Splash = ({navigation}) => {

    setTimeout(()=>{
        navigation.replace('Onboarding')
    },3000)
    return (
        <View style={{flex:1,flexDirection:'column',justifyContent:'center',alignItems:'center',backgroundColor:Colors.white}} >
            <StatusBar barStyle="light-content" hidden={false} backgroundColor="#0079AB" /> 
            <Image source={require('../assets/images/icon1.png')} style={{width:50,height:50}}  />    
            <Text style={{fontFamily:'OpenSans-Bold',fontSize:30,color:Colors.primary}} >Machine Scan</Text>
        </View>
    )
}

export default Splash

const styles = StyleSheet.create({})
